import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Outlet } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';

import SignIn from './pages/signin';
import SignUp from './pages/signup';
import ForgotPassword from './pages/forgotpasseword';

import DashboardUserLayout from './layouts/DashboardUserLayout';
import Home from './pages/Home';
import CommentCaMarche from './pages/CommentCaMarche';
import ImporterDonnees from './pages/ImporterDonnees';
import Historique from './pages/Historique';
import MonCompte from './pages/MonCompte';

// ✅ Route protégée : accessible seulement si connecté
const PrivateRoute = () => {
  const { user } = useAuth();
  return user ? <Outlet /> : <Navigate to="/" />;
};

// ✅ Si déjà connecté, empêche d'accéder à signin/signup
const PublicOnlyRoute = ({ element }) => {
  const { user } = useAuth();
  return user ? <Navigate to="/dashboard" /> : element;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* ✅ Page par défaut = SignIn */}
          <Route path="/" element={<PublicOnlyRoute element={<SignIn />} />} />
          <Route path="/signin" element={<PublicOnlyRoute element={<SignIn />} />} />
          <Route path="/signup" element={<PublicOnlyRoute element={<SignUp />} />} />
          <Route path="/forgotpasseword" element={<ForgotPassword />} />

          {/* ✅ Routes protégées du dashboard */}
          <Route path="/dashboard" element={<PrivateRoute />}>
            <Route index element={<Home />} />
            <Route path="comment-ca-marche" element={<CommentCaMarche />} />
            <Route path="importer" element={<ImporterDonnees />} />
            <Route path="historique" element={<Historique />} />
            <Route path="mon-compte" element={<MonCompte />} />
          </Route>

          {/* ✅ Route fallback en cas d'erreur */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
